package com.yahoo;

import java.util.ArrayList;
import java.util.HashSet;
import java.util.List;

/**
 * Created on 4/6/15.
 */
public class RepeatedDnaSequences {

    RepeatedDnaSequences() {
        System.out.println(findRepeatedDnaSequences("AAAAAAAAAAA"));
        System.out.println(findRepeatedDnaSequences("AAAAACCCCCAAAAACCCCCCAAAAAGGGTTT"));
        System.out.println(findRepeatedDnaSequences(""));
    }

    /**
     * Solution that uses memory... but should be efficient.
     * Apparently there's a faster way with bit-manipulation (I guess using the fact there are only 4-characters).
     * @param s
     * @return
     */
    public static List<String> findRepeatedDnaSequences(String s) {
        HashSet<String> duplicates = new HashSet();

        if (s.length() < 10) { return new ArrayList<String>(); }

        HashSet<String> seen = new HashSet();
        for (int i = 0; i < s.length() - 9; i++) {
            String testString = s.substring(i, i+10);
            if (seen.contains(testString)) {
                duplicates.add(testString);
            } else {
                seen.add(testString);
            }
        }

        ArrayList out = new ArrayList<String>(duplicates);
        return out;
    }

    public static void main(String[] args) {
        new RepeatedDnaSequences();
    }
}
